import './Pieces.css'
import Piece from './Piece.js'

const Pieces = () => {
    const position = new Array(8).fill('').map(x => new Array(8).fill(''))
    console.log(position);


    position[0][0] = 'bishop_b'
    position[1][7] = 'king_b'
    position[2][7] = 'knight_b'
    position[3][7] = 'pawn_b'
    position[4][7] = 'queen_b'
    position[5][7] = 'rook_w'

    return <div className='pieces'>
        {
            position.map((r,rank) =>
                r.map((f,file) =>
                    position[rank][file]
                        ? <Piece
                        key={rank+'-'+file}
                        rank={rank}
                        file={file}
                        piece={position[rank][file]} />
                        : null
                ))
        }
    </div>
}

export default Pieces
